import { SET_USER_EMAIL } from '../actions';

const INITIAL_STATE = {
  user: {
    email: '',
  },
};

const userReducer = (state = INITIAL_STATE, action) => {
  switch (action.type) {
  case SET_USER_EMAIL:
    return { user: { email: action.payload } };
  default:
    return state;
  }
};

export default userReducer;
